import React,{useState, useEffect} from 'react'
import Navbar from './Navbar'
import Main from './Main'
import axios from 'axios';
import './App.css';

function App() {
  const [venues, setVenues] = useState([])

  const [location, setLocation] = useState({ lat: null, lng: null })


  useEffect(() => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(function (position) {
        setLocation({ lat: position.coords.latitude, lng: position.coords.longitude })
        console.log(location.lat)
      });
    }
  }, [])

  const onTextSubmit = (e) => {
    axios.get(`https://api.foursquare.com/v2/venues/search?client_id=LIEUSSAMWMOVTOT2NMXPTPQ1VJ5UIESU3EJKN53JV4QIKMZL&client_secret=FURPJP2L1EQJHTT3Y05RAEJOOLBPXTMALC1OJ3NQ2LAHYT5G&ll=${location.lat},${location.lng}&query=pizza&v=20189988&limit=10`)
      .then(res => {
        const venues = res.data.response.venues;

        setVenues(venues)
        console.log(venues);
      })
      .catch(err => {
        console.log(err)
      })
  }

  return (
    <div className="App">
      <Navbar/>
      <Main location={location} venues={venues}/>
    </div>
  );
}

export default App;
